            if (modules.Contains("*") || modules.Contains("Kistl.App.Base")) XmlStreamer.ToStream(this.Proxy.Property != null ? this.Proxy.Property.ExportGuid : (Guid?)null, xml, "Property", "Kistl.App.Base");
        }

